const Article = ({nom},{description},{handleClick},{buttonName},{activeForm},{modifNom},{modifDescription}) => {

    let form=null

    if(activeForm){
        form=

       <div>
         <p>Modifier nom</p>
         <input type='text' maxLength="15"  onChange={modifNom}/>
         <p>Modifier description</p>
         <input type='text' maxLength="200"  onChange={modifDescription}/>
       </div>
    }

    return ( 
    <div>
      <p>{nom}</p>
      <p>{description}</p>
      <button onClick={handleClick}>{buttonName}</button>
      <div>{form}</div>
    </div>
     );
}

export default Article ;
